    }

    return ( 
        <div id="projects">
            <div className="sectionHeader">
                <span className="sectiontitle">/ projects<div className="divideLine"></div></span>
            </div>
            <div className="projectList">
                <ul className="projGrid">
                    {Object.keys(softwares).map((keys, i) => (
                       <li className="projCard">
