                                <span className="external-links">
                                    <a href="/" className="github-icon">
                                        <GitHubIcon style={{fontSize:25}}></GitHubIcon>
                                    </a>
                                    {softwares[key]["open"] && (
                                        <a href="/" className="open-icon">
